<template>
  <div class="h-screen flex w-full bg-img vx-row no-gutter items-center justify-center" id="page-login" >
    <div class="container">
      <div class="form__img">
        <svg width="192" height="48" viewBox="0 0 192 48" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect width="192" height="48" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_226:6294" transform="translate(0 -0.0173675) scale(0.000914077 0.00365631)"/>
</pattern>
<image id="image0_226:6294" width="1094" height="283" xlink:href="data:image/png;base64,"/>
</defs>
</svg>
      </div>
      <div class="form">
        <h2>Login</h2>
        <div class="form__inputs">
        <input 
        v-validate="'required|min:3'"
        data-vv-validate-on="blur"
        name="username"
        class="mb-0"
        icon-no-border
        icon="icon icon-user"
        icon-pack="feather"
        label-placeholder="Username"
        v-model="username"
          />
          <span class="text-danger text-sm flex justify-content-flex-end mt-2 ml-2">{{ errors.first('username') }}</span>
          <input      
          @keypress.enter="loginJWT"   
          data-vv-validate-on="blur"
        v-validate="'required|min:6|max:10'"
        type="password"
        name="password"
        icon-no-border
        icon="icon icon-lock"
        icon-pack="feather"
        label-placeholder="Password"
        v-model="password"
        class="w-full mt-6 mb-0" />
        <span class="text-danger flex justify-content-flex-end text-sm mt-2 ml-2">
          {{ errors.first('password') }}
        </span>
      <div class="flex flex-wrap justify-between my-5" style="margin-top: 30px !important" >
        <vs-checkbox v-model="checkbox_remember_me" class="mb-3">Remember Me</vs-checkbox>
        <router-link to="">Forgot Password?</router-link>
    </div>
        </div>
        <div class="form__btn" style="margin-left: 12rem">
          <vs-button style="background: #f9896b !important;" :disabled="!validateForm" @click="loginJWT">Submit</vs-button>
          <vs-button type="submit">Cancel</vs-button>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
export default {
  data () {
    return {
      username: 'admin@admin.com',
      password: 'adminadmin',
      checkbox_remember_me: false
    }
  },
  computed: {
    validateForm () {
      return !this.errors.any() && this.email !== '' && this.password !== ''
    }
  },
  methods: {
    loginJWT () {
      // Loading
      this.$vs.loading()
      const payload = {
        checkbox_remember_me: this.checkbox_remember_me,
        userDetails: {
          username: this.username,
          password: this.password
        }
      }
      this.$store.dispatch('auth/loginJWT', payload)
        .then(() => {
          this.$acl.change(localStorage.getItem('UserInfo'))
          this.$vs.loading.close()
        this.$router.push('/')
        })
        .catch(error => {
          this.$vs.loading.close()
          this.$vs.notify({
            title: 'Error',
            text: error.message,
            iconPack: 'feather',
            icon: 'icon-alert-circle',
            color: 'danger'
          })
        })
    },
  },
  mounted(){
    // const nus = 'admin'
    console.log(this.$acl);
  }
}

</script>
